  `idgrup` varchar(50) NOT NULL,
  `namagrup` varchar(100) DEFAULT NULL,
  `keterangan` varchar(200) DEFAULT NULL,
  `tglinsert` datetime DEFAULT NULL,
  `tglupdate` datetime DEFAULT NULL,
